const delay = ms => new Promise(res => setTimeout(res, ms));
export default function AvatarNftMint (props) {
  const history = useHistory();
  const [ eligible, setEligible ] = useState([]);
  const [ receivers,setReceivers ] = useState([]);
  const { writeContracts, readContracts, tx } = props;
  async function drop(r,i) {
    try {
      eligible[i].state = "X";  
      console.log("tx" + r.owner +"=> "+ "0x"+ r.metadataHash);
      /*
      tx(writeContracts.Avatar.create(r.addr, r.hash),
      update => {
            console.log("tx", update)
            if (update?.error?.toString()) {
               eligible[i].status = update?.error?.toString();
               helpers.speak("FAIL");
            }
            if (update && (update.status === "confirmed" || update.status === 1)) {
               console.log("  Transaction " + update);
               eligible[i].status = "OK"; 
               helpers.speak("OK");
            }
         }, 
      );*/
    
    } catch (e) {
        console.error(e);
        tokenDrop[i].status = "ERROR";
    }
    setReceivers(tokenDrop);
    return 0;
  }
  /*
  function getNumTokens = (async () => {
    console.log("avatar contract", readContracts.Avatar);
    
    for (let i = 0; i < tokenDrop.length; i++) {
        try{
        tokenDrop[i].balance = (await readContracts.Avatar.balanceOf(tokenDrop[i].addr)).toString();
        await delay(1000);
        console.log(i, tokenDrop[i].balance);
        } catch(e) {
            console.error("getting balance", tokenDrop[i].addr, i);
        }
    }
  });*/
  var stopRetrival = false;

  const fetchAll = useCallback(async () => {
    if(readContracts.Avatar==undefined) return;

    var tokens = [];
    var totalXP = 0;
    var totalLevel = 0; //(times claimed)
    const allTokens = await readContracts.Avatar.totalSupply();
    console.log("Getting egligaible tokens", allTokens.toNumber());
    for (let tokenIndex = 0; tokenIndex < allTokens; tokenIndex++) {
      try 
      {
         var token = await getAvatarInfo(tokenIndex);
         if(token===null) continue;
         tokens.push(token);
         totalXP+=token.xp;
         totalLevel+=token.data.avatar.abilities.level.toNumber();

         tokens = tokens.sort((a, b) => b.xp - a.xp);
         setEligible(tokens);
      } catch(e)
      {
        console.log("Error getting token", tokenIndex, e);
      }
    }

    tokens = tokens.sort((a, b) => b.xp - a.xp);
    setEligible(tokens);
    console.log("Eligible tokens", tokens.length, tokens, "totalXP", totalXP, "totalLevel", totalLevel);

  }, [readContracts]); 

  async function getAvatarInfo(tokenId)
  {
    var avatarInfo = await readContracts.Avatar.getAvatarInfo(tokenId);
    const xp = avatarInfo.experience.toNumber();
    if(xp===0 && avatarInfo.name==="") 
    {
      //console.log("not valid for drop", tokenId);
      return null;
    }

    var owner = await readContracts.Avatar.ownerOf(tokenId);

    //console.log(""+tokenId, avatarInfo);
    var token = {};
    token.name = avatarInfo.name;
    // token.avatar = avatarInfo;
    token.xp = xp; 
    token.id = tokenId;
    //token.uri = avatar;
    var ability = await readContracts.AvatarAbility.getInfo(avatarInfo.skillId.toNumber()) 
    var reputation = await readContracts.AvatarReputation.getInfo(avatarInfo.reputationId.toNumber());
    var plur = await readContracts.AvatarPlur.getInfo(avatarInfo.plurId.toNumber());
    var relatable = await readContracts.AvatarRelatable.getInfo(avatarInfo.relatableId.toNumber());

    var imagePath = avatarInfo.swarmLocation.substring(2);

    var data = {
      description: "WeAreMillions Spring 2022 Hackathon",
      external_url: "https://resistance.fairdatasociety.org/viewNftAvatar/"+owner+"/"+tokenId,
      image: "https://gateway.fairdatasociety.org/bzz/"+imagePath+"/",
      name:  avatarInfo.name,
      metadataHash: "",
      attributes: []
      /*  { 
          "trait_type": "BackgroundColor", 
          "value": "Some color" 
         },
      ] */
    };

    data.attributes.push({"trait_type": "Experience", "value": avatarInfo.experience.toNumber()} );

    data.attributes.push({"trait_type": "Training", "value": ability.p1.toNumber()} );
    data.attributes.push({"trait_type": "Charisma", "value": ability.p2.toNumber()} ); 
    data.attributes.push({"trait_type": "Constitution", "value": ability.p3.toNumber() });
    data.attributes.push({"trait_type": "Dexterity", "value": ability.p4.toNumber() });
    data.attributes.push({"trait_type": "Intelligence", "value": ability.p5.toNumber() });
    data.attributes.push({"trait_type": "Strength", "value": ability.p6.toNumber() });
    data.attributes.push({"trait_type": "AbilityLevel", "value": ability.level.toNumber() });
    data.attributes.push({"trait_type": "AbilityPoints", "value": ability.points.toNumber() });

    data.attributes.push({"trait_type": "Reputation", "value": reputation.p1.toNumber()} );
    data.attributes.push({"trait_type": "Visibility", "value": reputation.p2.toNumber()} ); 
    data.attributes.push({"trait_type": "Distinctiveness", "value": reputation.p3.toNumber() });
    data.attributes.push({"trait_type": "Authenticity", "value": reputation.p4.toNumber() });
    data.attributes.push({"trait_type": "Transparency", "value": reputation.p5.toNumber() });
    data.attributes.push({"trait_type": "Consistency", "value": reputation.p6.toNumber() });
    data.attributes.push({"trait_type": "Reputation Level", "value": reputation.level.toNumber() });
    data.attributes.push({"trait_type": "Reputation Points", "value": reputation.points.toNumber() });

    data.attributes.push({"trait_type": "Peace", "value": plur.p1.toNumber()} );
    data.attributes.push({"trait_type": "Love", "value": plur.p2.toNumber()} ); 
    data.attributes.push({"trait_type": "Unity", "value": plur.p3.toNumber() });
    data.attributes.push({"trait_type": "Respect", "value": plur.p4.toNumber() });
    data.attributes.push({"trait_type": "Courage", "value": plur.p5.toNumber() });
    data.attributes.push({"trait_type": "Justice", "value": plur.p6.toNumber() });
    data.attributes.push({"trait_type": "PLUR Level", "value": plur.level.toNumber() });
    data.attributes.push({"trait_type": "PLUR Points", "value": plur.points.toNumber() });

    data.attributes.push({"trait_type": "Privacy", "value": relatable.p1.toNumber()} );
    data.attributes.push({"trait_type": "Interoperability", "value": relatable.p2.toNumber()} ); 
    data.attributes.push({"trait_type": "Sovereignty", "value": relatable.p3.toNumber() });
    data.attributes.push({"trait_type": "Force for good", "value": relatable.p4.toNumber() });
    data.attributes.push({"trait_type": "Support", "value": relatable.p5.toNumber() });
    data.attributes.push({"trait_type": "Symmetry", "value": relatable.p6.toNumber() });
    data.attributes.push({"trait_type": "Relatable Level", "value": relatable.level.toNumber() });
    data.attributes.push({"trait_type": "Relatable Points", "value": relatable.points.toNumber() });

    data.attributes.push({"trait_type": "Origin Id", "value": tokenId} );
    data.attributes.push({"trait_type": "Original", "value": owner} );
    // upload 
    token.data = data; // data goes to swarm
    token.owner = owner;

    data.avatar = {};
    data.avatar.info = avatarInfo;
    data.avatar.abilities = ability;
    data.avatar.reputation = reputation;
    data.avatar.plur = plur;
    data.avatar.relatable = relatable;

    var hash = await uploadJsonToBee(data, "wam-avatar-"+tokenId+".json");
    token.metadataHash = hash; //<- you this is how you mint this token

    console.log(tokenId, token);
    return token;
  }

  // console.log(receivers);
  async function getBalance(i) {
    /*try{
        if(tokenDrop[i].addr.includes("Batch")) return;

        tokenDrop[i].balance = (await readContracts.Avatar.balanceOf(tokenDrop[i].addr)).toString();
        console.log(i, tokenDrop[i].balance);

        setReceivers(tokenDrop);
    } catch(e) {
        console.error("getting balance", tokenDrop[i].addr, i);
    }*/
  }
  useEffect(() => {
    setReceivers(tokenDrop);
    fetchAll();
  }, []);
  useEffect(() => {
  }, [receivers]);
  useEffect( () => () => { console.log("unmount"); stopRetrival=true;}, [] );

  return (
    <div
      style={{
        maxWidth: 1050,
        margin: "auto",
        marginTop: 16,
        paddingBottom: 16,
        alignItems: "left",
        textAlign: "left",
      }}>
      <h1>Eligible Avatar NFT</h1>      

      {eligible.map((t,i) => (
        <div style={{lineHeight:"1.5rem"}} key={"parent_" + i}>
         {i}{"> "} <strong onClick={e=>{drop(t,i)}}>{t.name}</strong>&emsp;&emsp;XP: {t.xp} &emsp;&emsp;&emsp; #{t.id} 
         {t.state ? <strong> X</strong> : <span></span>}
         <br/> <small>{t.owner} {" => "} {t.metadataHash}</small>  
         {t.minted ? <strong> MINTED </strong> : <span></span>}
         {t.status}
         <br/>
        </div>
      ))}


      {receivers.map((p, i) => (
          <div
            style={{lineHeight:"1.5rem"}}
            key={"parent_" + i}
            
          >
            {i%6==0 && <br/>}

            <span onClick={e=>{ getBalance(i); }}>{i.toString()}</span>: <span onClick={e => {
                drop(p,i);
            }}><strong>{p.addr}</strong> {p.state} </span> <span>{p.balance}</span> <span style={{fontSize:"0.5rem", width:"100px", overflow:"hidden", textOverflow:"ellipsis"}}> {p.status} </span>
          </div>
        ))}

      <div>
      </div>
     </div>
  )
}

